-- title:  Dungeoneer
-- author: Balistc Ghouls Studios
-- desc:   A WIP
-- script: lua

t=0
tb=0
x=2*8
y=9*8
flp=1

function TIC()

	if btnp(0) then y=y-8 end
	if btnp(1) then y=y+8 end
	if btn(2) then x=x-1 flp=0 end
	if btn(3) then x=x+1 flp=1 end

	cls(0)
	map(0,0)
	
	--mobs
	spr(324+t%150//30*2,8*8,2*8,9,1,0,0,2,2)
	spr(352+tb%60//30*2,18*8,9*8,0,1,1,0,2,2)
	
	--items
	spr(398,5*8,14*8,0,1,0,0,2,2)
	spr(430,7*8-1,14*8,0,1,0,0,2,2)
	spr(462,11*8-2,14*8,0,1,0,0,2,2)
	
	--buttons
	spr(496,4*8+4,13*8+4,0)
	spr(497,6*8+4,13*8+4,0)
	
	--coins/keys
	spr(480+t%120//30,7*8,9*8,0)
	
	--token amount
	spr(480,16*8,15*8+5,0)
	spr(176,16*8,14*8,0,1,0,0,1,2)
	spr(177,17*8,14*8)
	spr(177,17*8,15*8+4)
	--numbers
	spr(451,18*8-4,15*8+4,0,1,0,0,1,2)
	spr(452,19*8-4,15*8+4,0,1,0,0,1,2)
	spr(451,18*8-4,14*8,0,1,0,0,1,2)
	spr(451,19*8-4,14*8,0,1,0,0,1,2)
	
	--my health
	spr(160,1*8+2,14*8,0)
	spr(160,2*8+2,14*8,0)
	spr(160,3*8+2,14*8,0)
	spr(160,1*8+2,15*8,0)
	spr(160,2*8+2,15*8,0)
	spr(160,3*8+2,15*8,0)
	
	--me!
	spr(256+t%120//30*2,x,y,0,1,flp,0,2,2)
	
	t=t+3
	tb=tb+2
end

